import React from 'react';
import { BrowserRouter,Routes,Route } from 'react-router-dom';
import Detail from './pages/Detail';
import Home from './pages/Home';
import 'bootstrap/dist/css/bootstrap.min.css';
import Result from './pages/Result';
import Ajout from './pages/Ajout';
import Navigation from './components/Navigation';
const App = () => {
  return (

    <BrowserRouter>
    <div className="Result" align="center">
            <h1>Ajout de these</h1>
            <div className="container">
                <div className="row">
                    <div className="p-2 col-2 border border-primary rounded" >

                    <br /><br />
                    <button type="button" className="btn btn-outline-primary">Ajout de these</button>
                    <br /> <br />
                    <button type="button" className="btn btn-outline-primary">Gestion Utilisateur</button>
                    <br /><br />
                    <button type="button" className="btn btn-outline-primary">Gestion des theses</button>
                    <br /><br />
                    <button type="button" className="btn btn-outline-primary">Statistiques</button>

                    </div>
                    <div className=" border border-primary rounded col-10">
                    <Routes>
                        <Route path="/" element={<Home/>}/>
                        <Route path="/Detail" element={<Detail/>}/>
                        <Route path="/Result" element={<Result/>}/>
                        <Route path="/Ajout" element={<Ajout/>}/>
                    </Routes>


                    </div>
                </div>
                </div>
             </div>

    </BrowserRouter>
  );
};

export default App;
